import { REGISTER_USER, REGISTER_USER_SUCCESS } from './action';

const initialState = {};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case REGISTER_USER:
      return { ...state };
  }
  return state;
};

export default reducer;
